import React, { Component } from 'react';
import './App.css';
import RecipeList from './components/RecipeList';
import RecipeDetail from './components/RecipeDetail';
import Navbar from './components/Navbar/Navbars';
class App extends Component {
  render() {
    return (
      <React.Fragment>
        <Navbar />
        <RecipeList />
        <RecipeDetail />
      </React.Fragment>
    );
  }
}

export default App;
